import styled from 'styled-components';

const Container = styled.div`
    height: inherit;
    margin: 0 auto;
    padding: 0 16px;
`;

const CompressContainer = styled(Container)`
    @media(min-width: 768px) {
        width: 80%;
    }
`;

export {
    Container,
    CompressContainer,
};
